import React from "react";
import "./App.css";
import Row from "./Row";
import requests from "./request";

function App() {
   return (
      <div className="App">
         <h1>Hey Jarvis Lets Build Netflix-Clone</h1>
         <Row title="NETLIX ORIGINAL" fetchUrl = {requests.fetchNetflixOriginals} />
         <Row title="Treanding Now" fetchUrl = {requests.fetchTreanding} />

      </div>
   );
}

export default App;
